import React, { Component } from "react";
import Background from '../../../src/images/DSCF7620_Vlai_Ly.jpg';

const sectionStyle = {
  width: "100%",
  height: "100vh",
  backgroundImage: `url(${Background})`
};

const Search = props => (
        <div>
            <h1>SEARCH</h1>
            <div>
                <img src={Background}></img>
            </div>
        </div>
)

export default Search;
